svg.script:
      
	  	var obc;
	  window.onSVGLoad=initLater();
		function initLater() {
     	//this timeout is because of the bbox bug in Firefox which prevents to have access to bbox in onload scripts
     	window.setTimeout("init()",0);
    }
	function init() {
		
		var zta=document.getElementById("zta");
		var child = zta.firstChild;
		while (child != null) {
				child.addEventListener("mouseover", Highlight, false);
				child.addEventListener("mouseout", HighlightRecover, false);	
				child.addEventListener("click",changecolora,false);
				child = child.nextSibling;
			}
			}
			var ztb=document.getElementById("ztb");
/*	var child = ztb.firstChild;
		while (child != null) {
				child.addEventListener("mouseover", Highlight, false);
				child.addEventListener("mouseout", HighlightRecover, false);
			//	child.addEventListener("click",changecolorb,false);				
				child = child.nextSibling;
			}
			*/
	}
	
	  
	function Highlight(evt) {
			var obj = evt.target;
			obc=obj.getAttributeNS(null,"class");
	        obj.setAttributeNS(null,"class", "fil50");
	}
	function HighlightRecover(evt) {
			var obj = evt.target;
			obj.class=obc;
			obj.setAttributeNS(null,"class", obc);
	}
	
	function changecolora(evt){
	var obj=evt.target;
	var idname=obj.getAttributeNS(null, "id");
	//alert(idname);
	for(var i=1; i<25; i++){
		var objmap=document.getElementById('a'+i);
	//	alert(objmap);
		var tagname =objmap.getAttributeNS(null,"tag");
	//	alert(tagname);
		if(tagname == idname){
		  objmap.setAttributeNS(null,"class", "fil50");}
		else{
			objmap.setAttributeNS(null,"class", "fil20 str2182");}
		}
	}
  function closeinfotip(n)
	{
	document.getElementById('infotip'+n).setAttribute("style", "visibility: hidden"); 
	}
